/**
 * initAreaComponent地区四级联动组件
 * 
 * 功能：动态生成四级联动的地区选择select标签
 * @param String  _containerId
 * @param String _isShowArr
 * @param String _defaultCode
 * @param String _selectId;
 * @param String _selDefault;
 * @param String _selDefaultTxt;
 * 
 * _containerId:
 *  必填 
 *  eg:'country,province,city,area'
 * 	放置select标签的容器ID 如果要将select放置在不同的容器中，请传入不同容器的id并以“,”逗号分隔ID
 *  注意：如果设置了两个以上的容器ID，就必须补全4个容器ID
 *  
 *  _isShowArr:
 *  选填
 *   eg:'1-s1,1-s2,1-s3,1-s4'
 *   设置select标签是否显示 同时设置显示的select标签的name值，每个select字符串以"-"分隔，"-"后之前1表示显示0表示不显示，"-"后面表示相对应的name值
 *   注意：显示与否的控制字符串必须填完整，
 *  
 *  _defaultCode
 *  选填
 *   eg:'1-330624'
 *   设置默认选中的国家，省份，城市，地区;
 *   其中第1位表示国家代码
 *   "-"后面的代码表示省份，城市，地区
 *  
 *  _selectId
 *  选填
 *  	eg:'hello'
 *  设置生成的select id值,四个ID依次递增,如hello1,hello2,hello3,hello4
 *  
 *  _selDefault
 *  选填
 *  	eg:true
 *  设置后面的选择框在选择时是否自动补全
 *  _selDefaultTxt
 *  选填
 *  	eg:true
 *  设置省份TEXT框的初始值
 *  
 *  使用方法：
 *  var myArea = new initAreaComponent('country,province,city,area','1-s1,1-s2,1-s3,1-s4','1-330624','a',true,'家乡');
 *  myArea.initalize(); 
 *   
 */

