function initAreaComponent(_containerId,_isShowArr,_defaultCode,_selectId,_selDefault,_setTxt){
	try{
		this.containerArr = _containerId.split(',');
	}catch(e){
		alert('需要正确的容器ID');
	}
	
	if(_defaultCode){
		this.defaultCodeArr = _defaultCode.split(' ');	
	}else{
		this.defaultCodeArr = null;
	}
	
	try{
		this.isShowArr = _isShowArr.split(',');
	}catch(e){
		this.isShowArr = null;
	}
	
	if(_selDefault){
		this.selDefault = _selDefault;
	}else{
		this.selDefault = false;
	}
	
	if(_setTxt){
		this._setTxt = _setTxt;
	}
	
	this.selectId = _selectId;
	this.select1Dom = document.createElement('select');
	this.select2Dom = document.createElement('select');
	this.select3Dom = document.createElement('select');
	this.select4Dom = document.createElement('select');
	this.selectArr = [this.select1Dom,this.select2Dom,this.select3Dom,this.select4Dom];

	//默认值下标
	var ci = null,
		pi = null,
		ti = null,
		ai = null;
}

initAreaComponent.prototype.createOption = function (s,_name,_value,_isSelected){
	var option=document.createElement('option');
	option.text = _name;
	option.value = _value;
	
	if(_isSelected)option.selected = true;
	try
	{
		s.add(option,null);
	}
	catch(ex)
	{
		s.add(option);
	}
}

initAreaComponent.prototype.initalize = function(){
	var self = this;
	
	for(var i=0;i<4;i++){
		/** 为四个select创建默认的option **/
		if(!self.selDefault){
			self.createOption(self.selectArr[i],'请选择','0');
		}
		/** 有无name属性 **/
		if(self.isShowArr){
			if(self.isShowArr[i].split('-')[0] == 1){
				/** 是否放在同个id容器 **/
				if(self.containerArr.length <= 1){
					document.getElementById(self.containerArr[0]).appendChild(self.selectArr[i]);
				}else{
					document.getElementById(self.containerArr[i]).appendChild(self.selectArr[i]);
				}
			}
			self.selectArr[i].name = self.isShowArr[i].split('-')[1];
		}
		
		if(self.isShowArr == null){
			document.getElementById(self.containerArr[0]).appendChild(self.selectArr[i]);
		}
		
		
		/** 有无id属性 **/
		if (self.selectId) {
			self.selectArr[i].id = self.selectId + (i + 1);
		}
		
	}
	
	
	this.changeSelect1Dom(self.selectArr[0]);
	this.select1Dom.onchange = function(){
		if(self.selDefault){
			self.selectArr[1].options.length = 0;
			self.selectArr[2].options.length = 0;
			self.selectArr[3].options.length = 0;
		}else{
			self.selectArr[1].options.length = 1;
			self.selectArr[2].options.length = 1;
			self.selectArr[3].options.length = 1;
		}
		ci = this.value;
		self.changeSelect2Dom(self.selectArr[1]);
	}
	if(this.defaultCodeArr){
		setTimeout(setDefalt,1);
	}
	function setDefalt(){
		self.setDefaultArea(self.defaultCodeArr);
	}
}

initAreaComponent.prototype.setDefaultArea = function(areaCodeArr){

	var self = this;
		self.changeSelect1Dom(self.selectArr[0],areaCodeArr[0]);
		self.changeSelect2Dom(self.selectArr[1],areaCodeArr[1]);
		self.changeSelect3Dom(self.selectArr[2],areaCodeArr[2]);
		self.changeSelect4Dom(self.selectArr[3],areaCodeArr[3]);
}

initAreaComponent.prototype.changeSelect1Dom = function(_dom,_selectedName){
	var self = this;
	if(self.selDefault){
		_dom.options.length = 0;
	}else{
		_dom.options.length = 1;
		_dom.options[0].value = -1;
		_dom.options[0].text = '请选择';
		_dom.options.length = 1;
	}
		
	for(var i in areaJson){
		if (areaJson[i]['area_name'] == _selectedName){
			self.createOption(_dom,areaJson[i]['area_name'],i,i);
			ci = i;
		}else{
			self.createOption(_dom,areaJson[i]['area_name'],i);
		}
	}
	if (self.selDefault) {
		self.changeSelect2Dom(self.selectArr[1], _dom.options[0].value);
	}
}

initAreaComponent.prototype.changeSelect2Dom = function (_dom,_selectedName){
	var self = this;
	if(self.selDefault) {
		_dom.options.length = 0;
	}else{
		_dom.options.length = 1;
		_dom.options[0].value = -1;
		_dom.options[0].text = self._setTxt || '请选择';
	}
	if(self.selectArr[2] && self.selectArr[3] && !self.selDefault){
		self.selectArr[2].options.length = 1;
		self.selectArr[3].options.length = 1;
	}
	
	try{
		if(!areaJson[ci]||!areaJson[ci]['list']){
			return false;
		}
	}catch(e){
		return false;
	}
	
	for(var j in areaJson[ci]['list']){
		if (areaJson[ci]['list'][j]['area_name'] == _selectedName) {
			pi = j;
			self.createOption(_dom,areaJson[ci]['list'][j]['area_name'],j,j);
		}else{
			self.createOption(_dom,areaJson[ci]['list'][j]['area_name'],j);
		}
		
	}
	if (self.selectArr[2]) {
		_dom.onchange = function(){
			pi = this.value;
			self.changeSelect3Dom(self.selectArr[2]);
		}
	}
	if (self.selDefault) {
		self.changeSelect3Dom(self.selectArr[2], ci, _dom.options[0].value);
	}
	//alert(_dom.options.length);
}

